INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", -470.0, "ネア", 123301, 1, 2, 2, "2024/06/15 15:00:00", 0.0, 4.8, 5, 2002, 10021, "2024/09/22 14:59:59");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", -470.0, "カリザ", 133301, 3, 1, 1, "2024/09/15 15:00:00", 0.0, 4.922, 6, 2002, 10022, "2024/12/22 14:59:59");
