INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", -470.0, "グレイス", 133002, 2, 1, 1, "2024/12/15 15:00:00", 0.0, 1.78, 7, 2002, 10026, "2025/03/22 14:59:59");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", -470.0, "グレイス", 133002, 1, 2, 7, "2024/12/15 15:00:00", 0.0, 6.15, 7, 2002, 10027, "2025/03/22 14:59:59");
