INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", -470.0, "ルルィ", 136902, 2, 1, 1, "2025/03/15 15:00:00", 0.0, 5.53, 8, 2002, 10030, "2025/06/23 14:59:59");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", -470.0, "ルルィ", 136902, 9, 2, 7, "2025/03/15 15:00:00", 0.0, 6.05, 8, 2002, 10031, "2025/06/23 14:59:59");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", -470.0, "デュラン", 137001, 2, 1, 1, "2025/03/15 15:00:00", 0.0, 0.0, 8, 2002, 10032, "2025/06/23 14:59:59");
