INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("おう\n好きなもん持ってきな", -470.0, "サツキ", 135902, 2, 1, 2, "2025/06/16 15:00:00", 0.0, 0.0, 9, 2002, 10034, "2025/09/23 14:59:59");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", -470.0, "サツキ", 135902, 1, 2, 6, "2025/06/16 15:00:00", 0.0, 4.935, 9, 2002, 10035, "2025/09/23 14:59:59");
