INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", -470.0, "クルル", 130901, 2, 1, 2, "2025/09/16 15:00:00", 0.0, 2.295, 10, 2002, 10038, "2025/12/23 14:59:59");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", -470.0, "クルル", 130901, 1, 2, 6, "2025/09/16 15:00:00", 0.0, 6.281, 10, 2002, 10039, "2025/12/23 14:59:59");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", -470.0, "ヴォルガーノ", 137701, 2, 1, 1, "2025/09/16 15:00:00", 0.0, 5.549, 10, 2002, 10040, "2025/12/23 14:59:59");
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES ("…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", -470.0, "ヴォルガーノ", 137701, 3, 2, 6, "2025/09/16 15:00:00", 0.0, 2.64, 10, 2002, 10041, "2025/12/23 14:59:59");
